import React from 'react';
import InputBox from '../InputBox/InputBox';
import ImageUpload from '../ImageUpload/ImageUpload';
import './createmodpack.css';

const CreateModpack = () => {
  return (
    <div className='create-modpack'>
        <h1 className='create-modpack-header'> Create Modpack </h1>
        <div className='create-modpack-info'>
          
        <ImageUpload width={100} height={100}/>

          <div className='createmodpack-info-inputs'>
            <div className='create-modpack-info-inputs-container'>
              <p className='create-modpack-info-inputs-headers'> Modpack Name </p>
              <InputBox width={200} height={30} fontSize={"12px"} placeHolder={"Enter modpack name"} />
            </div>

            <div className='create-modpack-info-inputs-container'>
              <p className='create-modpack-info-inputs-headers'> Modpack Version </p>
              <InputBox width={200} height={30} fontSize={"12px"} placeHolder={"Enter modpack version"} />
            </div>

          </div>
        </div>
    </div>
  )
};

export default CreateModpack;
